import React from 'react'

//Sesion de importacion de los componentes
import './componentes/cuerpo.css';
import Cuerpo from './componentes/Cuerpo.jsx';
import Acordeon from './componentes/Acordeon.jsx';

// Sesion de importacion de uso de propiedades con Bootstrap
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";





function App() {
  return (

    // Clase contenedor
    <div className="bodyContenedores">

        {/* Sesion de container */}
      <Container>
        {/* Sesion de Uso del Grid */}
        <Row>
          <Col sm={8}>
            {/* <Image src={Img1} alt="" width="80%" rounded /> */}
          </Col>{" "}
          <Col sm={4}>
            {/* <Image src={Img2} alt="" width="70%" roundedCircle /> */}
          </Col>
        </Row>

        <Row>
          <Col sm={4}>
            {/* <Image src={Img3} alt="" width="70%" roundedCircle />{" "} */}
          </Col>{" "}
          <Col xs={8}>
            {/* <Image src={Img4} alt="" width="80%" thumbnail /> */}
          </Col>
        </Row>
      </Container>



      {/* Sesion de traerme los modulos de componentes */}
      <Cuerpo />
      <Acordeon />
    </div>
  )
}

export default App
